import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        TEST Malte is working here!
      </header>
    </div>
  );
}

// Function to test that jest is working
export const sum = (a, b) => {
  return a + b;
}

export default App;
